import Header from "../../components/header/Header";
import Footer from "../../components/footer/Footer";
import Cadastro from "../../components/cadastro/Cadastro";
import Lista from "../../components/lista/Lista";
import Banner from "../../assets/img/usuario.png"

const CadastroTipoUsuario = () => {
    return(
        <>
        <Header nomeusu = "Administrador"/>
       
            <Cadastro
                tituloCadastro="Cadastro Tipo de Usuario"
                namePlace="Titulo"
                imagem = {Banner}
        
            />

            
            <Lista titulo = "Lista tipo de Usuario"
                   tipos = "Tipo Usuario"
                   nome = "Titulo"/>
            

        
            <Footer/>
        </>
    )
}

export default CadastroTipoUsuario;
